offers.description:
Продаётся уютная квартира укомплектованная мебелью и бытовой техникой с качественным ремонтом, выполненным с использованием дорогостоящих импортных материалов: 
потолки окрашены краской Benjamin Moore (США), гипсовый декор с розетками под люстры, от фирмы Петергоф; 
стены окрашены краской little Green, стена на кухне облицована мозаичной плиткой Aparicj (Испания), в холле белая глянцевая 3D плитка Aparicj (Испания), в ванной крупноразмерная глянцевая и 3D плитка фирмы Aparicj (Испания); 
полы в ванной, холле, кухне-гостиной и на лоджии из мозаичной керамической плитки фирмы Aparicj (Испания), в спальной комнате полы из термопаркета Итальянской фабрики Tavar; 
столешница с раковинами в ванной из мрамора Emperador Dark (сделано в Испании), гидромассажная ванна с 2-мя режимами форсунок, производства Banacril (Испания) и душевая стеклянная кабинка (Испания); 
сантехника: унитаз, биде, смесители, души  фирмы FIMA (Италия), полотенцесушитель электрический с регулированием температуры и зеркало с подсветками фронтальной и боковой  фирмы Koh-i-Noor (Италия); 
встроенная кухонная мебель со столешницей из гранита Negro Galaxy (сделано в Испании), со встроенной бытовой техникой: холодильник, морозильник, индукционная варочная плита, вытяжка, посудомойка, стиральная машина, духовой шкаф, микроволновка -  KUPPERSBUSCH. 
Квартира общей площадью 94,4 кв. м2 в Ж К "Родной город Воронцовский парк". 
Площадь спальни 32 м2, кухни-гостиной 35,5 м2, большая ванная 10 м2, гардеробные  комнаты в прихожей и спальне. Панорамные окна. Высота потолков 3 метра. Закрытая территория, двор без машин, в подъезде охрана, по периметру видеонаблюдение, подземный паркинг. Дом бизнес - класса.
Свободная продажа. Квартира юридически чистая. В договоре полная стоимость.
